import React, { useState, useEffect } from 'react';
import MaterialTable from 'material-table';

const TableView = (props) =>{
  const { movieData, brushedIndex } = props;
  //console.log(`brushed:${brushedIndex}`);
  let tableData = [];


  useEffect(() => {
    //console.log(brushedIndex);
    brushedIndex.forEach(element => {
      tableData.push(movieData[element]);
    });
    console.log(tableData);
	}, [brushedIndex]);

  const columns = [
    { title: 'title', field: 'title' },
    { title: 'genre', field: 'genre' },
    { title: 'creative_type', field: 'creative_type' },
    { title: 'release', field: 'release' },
    { title: 'rating',field: 'rating' }
  ];

  return(
    <MaterialTable
          columns={columns}
          data={tableData}
          title="Demo Title"
        />
  )


}

export default TableView;
